import React, { Component } from 'react';
import { Nav, NavDropdown, Dropdown, FormControl, CustomMenu } from 'react-bootstrap';
import '../styles/CategoryMenu.css';




class CatagoryMenu extends Component {


	CustomToggle = React.forwardRef(({ children, onClick }, ref) => (
		<a
			href=""
			ref={ref}
			onClick={(e) => {
				e.preventDefault();
				onClick(e);
			}}
		>
			{children}
		  &#x25bc;
		</a>
	));


// forwardRef again here!
// Dropdown needs access to the DOM of the Menu to measure it
 CustomMenu = React.forwardRef(
	({ children, style, className, 'aria-labelledby': labeledBy }, ref) => {
		const [value, setValue] = useState('');

		return (
			<div
				ref={ref}
				style={style}
				className={className}
				aria-labelledby={labeledBy}
			>
				<FormControl
					autoFocus
					className="mx-3 my-2 w-auto"
					placeholder="Type to filter..."
					onChange={(e) => setValue(e.target.value)}
					value={value}
				/>
				<ul className="list-unstyled">
					{React.Children.toArray(children).filter(
						(child) =>
							!value || child.props.children.toLowerCase().startsWith(value),
					)}
				</ul>
			</div>
		);
	},
);



	render() {
		return (
			<Nav justify defaultActiveKey="/home" as="ul" className="itemDropnList">
				<Nav.Item as="li">
					<Nav.Link href="/home">Clothing</Nav.Link>

				</Nav.Item>
				<Nav.Item as="li">
					<Nav.Link eventKey="link-1">Sportwear</Nav.Link>
				</Nav.Item>
				<Nav.Item as="li">
					<Nav.Link eventKey="link-2">Outwear</Nav.Link>
				</Nav.Item>
				<Nav.Item as="li">
					<Nav.Link eventKey="link-3">Bags</Nav.Link>
				</Nav.Item>
				<Nav.Item as="li">
					<Nav.Link eventKey="link-4">Shose</Nav.Link>
				</Nav.Item>
				<Nav.Item as="li">
					<Nav.Link eventKey="link-5">Beauty</Nav.Link>
				</Nav.Item>
				<Nav.Item as="li">
					<Nav.Link eventKey="link-6">Accessories</Nav.Link>
				</Nav.Item>

				<NavDropdown className="itemDropnList" title="Dropdown" id="nav-dropdown">
					<NavDropdown.Item eventKey="4.1">Action</NavDropdown.Item>
					<NavDropdown.Item eventKey="4.2">Another action</NavDropdown.Item>
					<NavDropdown.Item eventKey="4.3">Something else here</NavDropdown.Item>
					<NavDropdown.Divider />
					<NavDropdown.Item eventKey="4.4">Separated link</NavDropdown.Item>
				</NavDropdown>
				<Dropdown>
					<Dropdown.Toggle as={CustomToggle} id="dropdown-custom-components">
						Custom toggle
    </Dropdown.Toggle>

					<Dropdown.Menu as={CustomMenu}>
						<Dropdown.Item eventKey="1">Red</Dropdown.Item>
						<Dropdown.Item eventKey="2">Blue</Dropdown.Item>
						<Dropdown.Item eventKey="3" active>
							Orange
      </Dropdown.Item>
						<Dropdown.Item eventKey="1">Red-Orange</Dropdown.Item>
					</Dropdown.Menu>
				</Dropdown>,
			</Nav>
		);
	}
}

export default CatagoryMenu;
